import styled from "styled-components"
import { HeaderMenu } from "../../Config/MenuConfig"

export const Header = () => {
  const sectionName = window.location.hash.substr(1)
  return(
    <SHeaderNav>
      <div>
        <a href="/#top">KYOSUKE OCHIAI</a>
      </div>
      <div>
        {HeaderMenu.map(menu => (
          <a key={menu.index} href={menu.link}>{menu.name}</a>
        ))}
      </div>
    </SHeaderNav>
  )
}
const SHeaderNav = styled.nav`
  position: fixed;
  display: flex;
  justify-content: space-;
  top: 0;
  z-index: 10000;
`
